            marker_198e47fb4ad8667e1ea29951be86b45e.bindTooltip(
                `<div>
                     21 Sep 44<br>nan<br>Boekhoute<br>After a day of rest, and short, unopposed trip to Sluiskil, the Argylls returned to Boekhoute (Bouchaute), Belgium. On 22 September, the Argylls supported an attack across the Isabella Canal by the Algonquin Regiment, but the strong German fortifications easily repelled any advances. The Battalion stayed in position for 10 days with little action.  The Argylls got to go on 12 hour leaves into Ghent, the first recreation they had seen since landing in France.
                 </div>`,
                {"sticky": true}
            );

            marker_fe60ddf282a0efc04d48b9b77ad8c6b8.bindTooltip(
                `<div>
                     02 Oct 44<br>nan<br>Kerselaar<br>The Argylls moved to Kerselaar on 02 October in preparation of crossing the Leopold Canal. On 06 October, the canal was crossed by 7th and 8th Brigades and the Argyll’s role was to feint a crossing to draw troops from the actual site of the attack. They brought forth sound equipment and played sounds of bridge-building activities, artillery and mortar would fire, smoke screens generated and the tanks and armoured personnel carriers would race back and forth. They were successful in drawing attention away from the main attack. On 10 October, the Argylls attempted to actually cross the canal and link up with the 9th brigade, but were unable to gain any ground, so retreated and held their previous positions. 
                 </div>`,
                {"sticky": true}
            );

            marker_363cd803a541bf1b1fcbadb97ec351c7.bindTooltip(
                `<div>
                     16 Oct 44<br>nan<br>Antwerp<br>In order to reduce the supply lines from England, it was necessary to open up the Channel ports, including Antwerp. Antwerp had been taken by the Allies, but the Scheldt Estuary was heavily defended by the Germans, so the 1st Canadian Army was called upon to clear the Scheldt. Gen Montgomery recognized that Antwerp would be essential to resupply troops crossing the Rhine into Germany, so declared the clearing of the Scheldt to be highest priority.
                 </div>`,
                {"sticky": true}
            );

                `<div>
                     17 Oct 44<br>nan<br>Schoten<br>On 16 October, the Battalion moved to a forested Area just north of Antwerp to prepare and rearm for the operation. The area was very wooded, so only a few main roads were assessable to the tanks. Heavy rearguard opposition as well as mines and booby traps were anticipated. 
                 </div>`,
                {"sticky": true}

                 </div>`,
                {"sticky": true}

            marker_7ee6e6eee563208ea142374956e49719.bindTooltip(
                `<div>
                     20 Oct 44<br>nan<br>Kalmthout<br>Start of Operation Suitcase. B Company met resistance soon after they started off.  There were not a lot of enemy soldiers, but the sniper and mortar fire was constant and a great many mines were encountered. The Battalion suffered 30 casualties, and the dead, including Maj Logie B Company commander were buried in the Kappellenbosch church yard. The graves are still tended by the local Dutch populace. 
                 </div>`,
                {"sticky": true}
            );

                `<div>
                     21 Oct 44<br>nan<br>Essen<br>At 2000 hours, the Argylls received orders to proceed west of Essen to prepare to clear and hold the woods west of Essen in support of the takeover of the village. The Battalion had become skilled at moving through the night through occupied territory and successfully found its way to the starting point.
                 </div>`,
                {"sticky": true}
            );

                `<div>
                     22 Oct 44<br>nan<br>West of Essen<br>On 22 October, the Battalion advanced facing only sporadic fire. The unit took a large number of prisoners, including 3 smartly dressed Germans returning from a party. The terrain was littered with German equipment, evidence of their recent presence. They captured 82 prisoners from many different units, and easily handled counter attacks as they came.
                 </div>`,
                {"sticky": true}
            );

            marker_bcaeae32d1ce77feb01498c49584bf24.bindTooltip(
                `<div>
                     24 Oct 44<br>nan<br>Wouwse Plantage<br>At 0100 on 24 October the Argylls along with the Canadian Grenadier Guards and Lake Superior Regiment were ordered to take Wouwse Plantage, but heavy rainy and thick mud delayed the Armour until 0445. A German self-propelled gun was in the middle of the road, and all but 2 tanks got stuck trying to bypass the obstacle. Some of the houses set afire by tank fire burned fiercely and highlighted the force resulting in the loss of the remaining two tanks. 
                 </div>`,
                {"sticky": true}
            );

            marker_8b432543c85ccfe3dd98bcaea2eaf9f3.bindTooltip(
                `<div>
                     26 Oct 44<br>nan<br>Hoogerheide<br>The Battalion establishment was for 817 Other Ranks, and the actual count at the end of October was 709, this despite the fact that 190 reinforcements had been taken on in 5 batches throughout the month of October.  Our Great Uncle, George Johnston B136879 was taken on strength to D company on 26 October 1944.  The unit establishment had dipped as low as 536 on 02 September, an indication of the steady casualty rate.
                 </div>`,
                {"sticky": true}
            );

            marker_4e5ab1677c75083d0fcf1cb258f8a719.bindTooltip(
                `<div>
                     28 Oct 44<br>nan<br>Bergen Op Zoom<br>The Argylls were taken back under the command of the 10th Canadian Infantry Brigade, and on 26 October moved up to Hoogerheide, Nehtherlands to clear the woods around Bergen Op Zoom. On 28 October word was received that the Lincoln and Welland and the South Alberta Regiments had takenBergen op Zoom, so the Argylls moved into the town to a tremendous reception from the populace despite the fact that gunfire could be heard nearby. At 0500 the Argylls got a few men across the causeway and fought house to house most of the day under constant fire, finally clearing a few hundred yards so the Engineers could repair the causeway. The tanks finally crossed the causeway, and the Argylls returned to Bergen op Zoom, suffering 56 casualties. 
                 </div>`,
                {"sticky": true}
            );

                `<div>
                     09 Nov 44<br>nan<br>Drunen<br>On 09 November, they moved to 50 miles Northeast to Drunen where they spent a quiet time with only nuisance with the Germans. Druin was the scene of an egregious German atrocity. For no apparent reason, before Germans departed, they gathered 300 civilians to the town hall on some pretext, then blew up the building. The Argylls Had a quiete time for two weeks.
                 </div>`,

            marker_f84f49e825490fbc5a6e964f6469e7cc.bindTooltip(
                `<div>
                     25 Nov 44<br>nan<br>Stokhoek<br>This quiet time lasted until 25 November when the Argylls were pulled out of the line completely and moved to the St Michaels-Gestel Monastary in Stokhoek for a two-week period. This was a period of maintenance, training, and recovery. The Battalion trained in the morning, participated in sports in the afternoon with cinemas, cafes and dances filling the evenings. 
                 </div>`,
                {"sticky": true}
            );

            marker_1ac30bf4c64894671dab11477302c8f7.bindTooltip(
                `<div>
                     21 Dec 44<br>nan<br>Stokhoek<br>On 16 December, the Germans launched what would be their final major attack of the War, the Attack in the Ardennes, also known as the Battle of the Bulge. The plan was for the German 5th and 6th Panzer Divisions to take Brussels and Antwerp, encircle and eliminate the British forces in Holland. Aided by deception and bad weather limiting reconnaissance, the attack was a complete surprise. Also north of the Maas River was large German force that was expected to move south and join up with the Attack from the Ardennes. Fortunately, the attack from the north was blunted early on.
                 </div>`,
                {"sticky": true}
            );

            marker_ead1d1e1d33ce116bf25a76662126bc0.bindTooltip(
                `<div>
                     09 Jan 45<br>nan<br>Waalwijk<br>On 09 January the Argylls moved a few miles north to Waalwijk where they remained until early February. They were in contact with the enemy with sporadic firing, but no major casualties. The Germans had established a bridgehead across the River Maas at Kapelsche Veer. Several attempts to dislodge the Germans failed until the Germans withdrew on 30 Jan.  The Canadians estimated the Germans lost 145 killed, 64 wounded and 34 captured. The Lincolns had 50 fatalities, and 129 wounded, and the Argylls suffered 13 killed and 32 wounded. 
                 </div>`,
                {"sticky": true}
            );

            marker_c3fc7fc0b8614e9a97a7e58c1c4f86b0.bindTooltip(
                `<div>
                     24 Feb 45<br>nan<br>Kleve<br>Operation Blockbuster was a major armoured assault to the town of Wesel on the bank of the Rhine River in preparation to the final push to Berlin. The attacking force included the 2nd and 3rd Canadian Infantry Divisions, 4th Canadian Armoured Division, 2nd Canadian Armoured Brigade 2nd Army Group Royal Canadian Artillery and the British 11th Armoured and 43rd (Wessex) Divisions. The assembled force included 90,000 infantry, 1300 artillery guns and over 1000. They were facing a force of 10,000 with 100 tanks and a few anti-tank weapons tanks including forces from the 2nd Parachute Corps and 47th Panzer Corps . 
                 </div>`,
                {"sticky": true}
            );

            marker_af01f6d1da461e3a6f80de9e817c16c3.bindTooltip(
                `<div>
                     26 Feb 45<br>nan<br>KalKar<br>The Argylls started off at 1800 hours on 25 February. The plan was to head cross country in 4 lines, but heavy rain had softened the ground and the tanks churned up the earth resulting in many of the armoured carriers becoming stuck and disabled. Many of the tanks from the Snuff and Jerry units were bogged down, some buried up to their turrets so the going was slow. The battlefield was congested and confusing, but the Arygll forces Snuff and Jock pushed on, meeting their objectives by 1930 on 26 February. The Battalion had taken 1500 prisoners, at the cost of 6 killed and 25 wounded. 
                 </div>`,
                {"sticky": true}
            );

            marker_07d970ec9ea3cc6b804be91892ed987e.bindTooltip(
                `<div>
                     27 Feb 45<br>nan<br>Keppeln<br>The Battle of the Hochwald Gap contiued on 27 Feb,  The 3rd Division moved to the hills east of Udem on the 27th, and the Tiger force pushed forward through the Hochwald forest, delayed by 5 hours due to the slow going through the mud. As a result at daylight they were still in open ground instead of in the forest, losing several tanks to anti-tank fire. At 0230 on 28 February, the Argylls advanced, and remained under heavy artillery and mortar fire, and repeated counter-attacks by the German forces. B company was cut off and spent the entire day in direct combat with the enemy, unable to be resupplied or to evacuate the wounded. B company had been reduced to 15 men after holding their position for 24 hours. The Argylls were replaced by the Mont Royal Fusiliers, and went back to Udem. LCol Wigle who had been wounded twice by shrapnel fire was awarded the DSO.
                 </div>`,
                {"sticky": true}
            );

            marker_5adc1c0941ac3a859dfde3970d6eaf62.bindTooltip(
                `<div>
                     06 Mar 45<br>nan<br>Sonsbeck<br>At 0800 on 06 March, the Argylls moved from Sonsbeck towards Veen. The land was very wet so the tanks were forced to stay on the roads which were heavily cratered and mined. They advanced with little resistance until 800 yards from Veen where they faced a storm of small arms, mortars and artillery fire. They waited until last light then B and D companies with tanks went forward into Veen.  They could make no headway and were order to withdraw, but Capt Perry did not receive the order and stayed in place. 
                 </div>`,
                {"sticky": true}
            );

            marker_58c69b1d5a4754acde05799e0a5fdf4c.bindTooltip(
                `<div>
                     07 Mar 45<br>nan<br>Sonsbeck<br>At dawn they were in shallow pits and dominated by German fire from 3 sides. Movement was impossible and the ammunition used up, so Capt Perry surrendered his force. A total of 31 members were taken prisoner including Lts Maxwell and Steward who were both severely wounded, and our great Uncle George Johnston. Lt Stewart later died of his wounds and was buried by the Germans in Veen. 
                 </div>`,
                {"sticky": true}
            );

            marker_ef1e515806eeaae579cbf8d3fa118707.bindTooltip(
                `<div>
                     13 Mar 45<br>nan<br>Esch<br>For the period from 26 February to 09 March the Argylls had lost 260 men killed or wounded, and 31 men taken prisoner. Total Canadian Casualties number 379 offices and 3395 other ranks. The Germans suffered 22,000 killed and 22,239 captured. The US Army had captured 30,000 prisoners with 16,000 casualties. The total number of German prisoners taken since 08 February totaled 230,000 along with the killed or wounded representing the destruction of 20 full divisions. On 12 March the Argylls were taken out of the line, and returned to the rest/training area at Esch near Boxtel. They were located near Waalwijk where the Battalion had wintered and were welcomed with open arms by the local populace. 
                 </div>`,
                {"sticky": true}
            );

            marker_27a4b51bcdb37e6b1777c743202408e8.bindTooltip(
                `<div>
                     30 Mar 45<br>nan<br>Kleve<br>The CO LCol Wigle insisted the troops be in top form, so the unit spent many days conducting route marches accompanied by one of the regiment’s pipers. They also trained for company attack schemes, woods-clearing and house to house fighting. After almost 2 weeks out of the fighting, the Argylls returned to Kleve on 30 March to begin the final assault on Germany.
                 </div>`,
                {"sticky": true}
            );

                `<div>
                     31 Mar 45<br>nan<br>Millingen<br> The next task of the 4th Canadian Armoured Division was to open the supply route north through Arnhem and clear Northern Holland. They Argylls were to again lead the division along with the South Alberta Regiment. At 1430 on 31 March, the Argylls crossed the Rhine and set up camp near Millingen.

            marker_5778672d4ca81a5d7fb5e51a62fc7442.bindTooltip(
                `<div>
                     05 Apr 45<br>nan<br>Amelo<br>After a hurried breakfast the companies started out on foot towards Almelo, and by first light were almost in the outskirts. The companies encountered no opposition whatsoever, taking a few PW in their rapid advance through the town. By 1000 hours the companies had cleared the town to the canal and had crossed the canal. The Germans had departed, and the Argylls were mobbed by excited locals. While in Amelo, the Battallion witnessed the head-shaving of female collaborators. In front of a jeering mob, the women were paraded one at a time to the balcony of the town hall and their heads roughly shaved. 
                 </div>`,
                {"sticky": true}
            );

            marker_74443d700579e6cbc6e29555b2da751b.bindTooltip(
                `<div>
                     06 Apr 45<br>nan<br>Wilsum<br>The Argylls moved to Wilsum in preration of the assault on Meppen. On the morning of 06 April, 2 companies of the Argylls moved towards Meppen to support the Lake Superior Regiment, as they had discovered Meppen was still occupied, and were not having success clearing the town. The Argylls set up camp in Klien Fullen, just east of Meppen and on the morning of 07 April followed the Lake Superiors into Meppen on the western side of the Ems River. In the afternoon Typhoon aircraft attacked the German positions on the east side of the river, and a night assault was planned. Due to delays in bringing forth the boats the artillery barrage began at 0530 on 08 April, and two companies crossed the river and took the town with very little resistance. 
                 </div>`,
                {"sticky": true}
            );

            marker_ceb8eacbf9c52c43d85082c1aeead871.bindTooltip(
                `<div>
                     08 Apr 45<br>nan<br>Meppen<br>Meppen was in good condition, and the Support company set up in a former German Officer’s mess dining on fine china, drinking Rhineland wine, and consuming tinned ham and fresh eggs for breakfast. The German citizens moved back in as soon as the fighting was over, but there was no fraternization with the soldiers. A former SS Headquarters yielded reams of Nazi notepaper, so the families back home received letters written on this letterhead for weeks. 
                 </div>`,
                {"sticky": true}
            );

            marker_eb41c1a0396ed19242f054b53e0145cc.bindTooltip(
                `<div>
                     14 Apr 45<br>nan<br>Friesoythe<br>, LCol Wigle’s plan was to cross the Soeste River and attack on foot from the east so the main guns could not be directed at them. In order to ensure they had communication a large radio set was carried in a stretcher. The speed and surprise of the attack led to only scattered resistance. At 0830 on 14 April, the CO set up headquarters in a house, but the troops were advancing so quickly that the house was quite far behind the front line. A small group of 50 German soldiers were attempting to make their escape when they were fired upon by the headquarters unit. The Germans attacked the house and LCol Wigle was killed, a huge blow to the Argylls.
                 </div>`,
                {"sticky": true}
            );

            marker_8ed9181bb085c6131fe3c8a460179435.bindTooltip(
                `<div>
                     18 Apr 45<br>nan<br>near Friesoythe<br>The next line of defence would be the Kusten Canal. The terrain was very low-lying and wet, so only the two main roads were available to the vehicles, resulting in very well guarded locations on the north side of the canal.  On 17 April, the Algonquins had a bridgehead across the canal, but very heavy fire prevented progress.  Two Argyll companies crossed the canal as well and shortly afterwards a German self-propelled gun drove the Algonquins back across the canal, but the Argylls held their positions.
                 </div>`,
                {"sticky": true}
            );

                `<div>
                     21 Apr 45<br>nan<br>Kusten Canal<br>The bridge was completed by dawn on 19 April, but was then immediately destroyed. The bridge was repaired, and the first tanks crossed at noon. The tanks could only progress via the main road, so the Argylls carried the fight throughout 19-20 April. The Argylls pressed ahead, completing another water crossing under heavy shelling. The Argylls had 9 killed and 35 wounded in the fight to cross the canal and river. By the evening of 23 April the 4 rifle companies strength was 8 officers and 205 men, down from the normal fighting strength of 12 officers and 400 men. 
                 </div>`,
                {"sticky": true}
            );

            marker_86afbc38cef4554b3daae571ae39ec80.bindTooltip(
                `<div>
                     25 Apr 45<br>nan<br>Osterscheps<br>The town of Osterscheps was taken by the Algonquins without a fight, but the Typhoons were kept busy until 24 April clearing the surrounding woods. The Germans made several counter-attacks to try to take back Osterscheps, initially over-running B Company at dawn on 24 Apr, but the position was retaken in a swift counter-thrust. The Argylls held the town, and the Lake Superiors pushed through and advanced. The Argylls then moved forward and other than some occasional shelling were out of the fight until 28 April . 
                 </div>`,
                {"sticky": true}
            );

            marker_e0d5bb5369932ec9edab0a2a9cbcb552.bindTooltip(
                `<div>
                     02 May 45<br>nan<br>Rostrup<br>The Argylls moved ahead on 02 and 03 May facing sufficient fire to limit their progress during the day. By 1400 on 04 May the town of Wiefelstede was taken with minimal resistance. They set out for Sphole, but were subject to mortar, artillery and sniper fire. They halted their attack to wait for night fall. They never got the order to advance as the Cease fire to end the war in Europe was called for 0800 05 May. The Argylls war was over. 
                 </div>`,
                {"sticky": true}
            );

            marker_91341b341ebc7085f867e9f35c032da7.bindTooltip(
                `<div>
                     12 May 45<br>nan<br>Nijverdal<br>After the conflict was over, the Argylls moved to Nijverdal, Holland to wait for repatiriation. Since they were one of the later units to cross the Atlantic, they would be among the last to return. An individual points system was employed to permit members with extended times away from Canada to return first, so high points personnel were replaced by reinforcements, so members who had served in Jamacia, England then Europe were repatriated first. 
                 </div>`,
                {"sticky": true}
            );

            marker_ded26a3bea4e79959641ac140d9d7748.bindTooltip(
                `<div>
                     04 Jul 45<br>nan<br>Berlin<br>The troops paraded for the raising of the British Flag over Berlin on 04 July, flying proudly on the Flag Pole from the 1936 Olympic Stadium.  Prime Minister Winston Churchill, President Harry Truman and General Stalin arrived for the Big 3 conference. Although the original plan was to have a joint parade, likely because the Russian soldiers were fighters and not well-trained in parade ground activities, it was decided to have separate parades for the 3 forces. On 21 July 1945, one year exactly after the Argylls had landed in Normany, the Canadians paraded with the British, reviewed by Winston Churchill, General Montgomery, US General Marshall and Admiral King, French Brigadeer de Beauchesne and Russian General Gorbatov. 
                 </div>`,
                {"sticky": true}
            );

            marker_84076d4ebfb96641d9a5bd6b0bb98e01.bindTooltip(
                `<div>
                     29 Jan 46<br>nan<br>Hamilton<br>On 21 Janaury 1946 the Argylls moved to Southampton then sailed home for Canada on the Ile de France. They docked in Halifax on 27 January, and boarded the train for Hamilton. They exited the train on 29 January and were greeted by the 2nd Battalion Argylls and thousands of cheering spectators. They paraded to the Armouries through the heart of the city between cheering crowds and showers of ticker tape and confetti. The families of the Argylls were all waiting at the Armoury and the long service of the Argylls came to an end with the command:
“1st Battalion, The Argyll and Sutherland Highlanders of Canada, DISMISS!”
                 </div>`,
                {"sticky": true}
            );
